    data: |
      SELECT + 90 FROM tab2 (FORMAT parquet) WHERE - 70 BETWEEN ( - - ( - col2 ) ) * + 54 + + + col0 AND + col2;
  - name: tab2

outputs:
  - name: q11184.out
    data: |
      90
      90
      90
